import React,{Component} from 'react';

class Count extends Component {
    state = {
        count :1,
        address: {
            street: "main",
            city : "San Francisco",
            s : "California "
        }
    }

    style = {
        backgroundColor : "black",
        color : "red",
        border : "1px solid black"
    }

    render(){
        return(
            <div>
                <h1 className="badge badge-primary m-2">{this.check()}</h1>
                <h3 style={this.style}>{this.state.address.street}</h3>
                <h3 style={{color: blue}}>{this.welcome()}</h3>
            </div>
        );
    }

    check(){
       return  this.state.count === 1 ? 'one' : this.state.count;
    }
    welcome(){
        const {address} = this.state;
        return  address.s === "California" ? <h1>Hello</h1> : address.s;
    }
}

export default Count;
